// Project.jsx
/*
SPDX-FileCopyrightText: Â© 2024 Heewon Kim <khw0285@gmail.com>
SPDX-License-Identifier: MIT
*/

import React, { useState, useEffect } from "react";
import {
    Container,
    Typography,
    Box,
    useTheme,
    useMediaQuery,
    responsiveFontSizes,
    ThemeProvider,
    Button,
} from "@mui/material";
import Carousel from "react-material-ui-carousel";

/**
 * Project component displaying a carousel of project information, including title, role, description, images, and demo link.
 */
const projectsData = [
    {
        title: "College Mate App",
        role: "Frontend Developer",
        description:
            "CollegeMate is a college community app designed exclusively for University of Wisconsin-Madison students. With CollegeMate, students can create and customize their schedules, download them as share class information them with friends within the app.",
        imageUrls: [
            "./CollegeMate1.png?as=webp",
            "./CollegeMate2.png?as=webp",
            "./CollegeMate3.png?as=webp",
        ],
        demoLink: "https://collegemate.app/",
    },
    {
        title: "Wisconsin SCO",
        role: "Backend Developer",
        description:
            "My key strengths lie in simplifying complex data and user interactions. I transformed a reliance on township expertise into a 50% more accessible map interface, and untangled 2,136 XML files with Python, building an export powerhouse that converts survey notes into any format, from CSV to JSON, empowering faster workflows and informed decisions. \n *A demo cannot be provided due to company privacy restrictions.",
        imageUrls: ["./SCOmap.png?as=webp", "./SCOgithub.png?as=webp"],
    },
    {
        title: "Portfolio",
        role: "Web Developer",
        description:
            "ðŸ‘©â€ðŸ’»ðŸš€ Dive into a vibrant tapestry of my skills and projects, showcased in this comprehensive portfolio. From weaving responsive and interactive designs with JSX, React, and Node.js to transforming intricate data into user-friendly tapestries, I leverage modern tools like MUI to breathe life into your vision. Unfurl the scroll to unveil the breadth of my expertise across web development and creative design â€“ click to see my work in action! #Portfolio #WebDev #Design",
        imageUrls: [
            "./portfolio1.png?as=webp",
            "./portfolio2.png?as=webp",
            "./portfolio3.png?as=webp",
            "./portfolio4.png?as=webp",
        ],
        demoLink: "https://github.com/Keemeeone/Portfolio/tree/main",
    },
];

const Project = () => {
    const theme = useTheme();
    const isSmallScreen = useMediaQuery(theme.breakpoints.down("sm"));
    const responsiveTheme = responsiveFontSizes(theme);

    const [currentImageIndex, setCurrentImageIndex] = useState(0);

    useEffect(() => {
        const intervalId = setInterval(() => {
            setCurrentImageIndex((prevIndex) => (prevIndex + 1) % projectsData.length);
        }, 2000);

        return () => clearInterval(intervalId);
    }, []);

    return (
        <ThemeProvider theme={responsiveTheme}>
            <Container
            >
                <Typography fontWeight={"bold"} variant="h2" mb={3} style={{ fontSize: isSmallScreen ? "1.5em" : "3em", textAlign: "center" }}>
                    Projects
                </Typography>

                <Carousel
                    autoPlay={true}
                    animation="slide"
                    timeout={500}
                    navButtonsAlwaysVisible
                    indicators={false}
                >
                    {projectsData.map((project, index) => (
                        <Box key={index} sx={{ display: "flex", flexDirection: 'column', justifyContent: "center", alignItems: "center" }}>
                            <img
                                alt={project.title}
                                src={
                                    project.imageUrls[currentImageIndex] ||
                                    project.imageUrls[0]
                                }
                                style={{ minHeight: "0", height: "100%", minWidth: "0", width: "100%", maxHeight: "50vh", maxWidth: "80%" }}
                            />
                            <Box sx={{ textAlign: "center" }}>
                                <Typography
                                    fontWeight={"bold"}
                                    textAlign={"center"}
                                    mb={2}
                                    sx={{ fontSize: { xs: "8px", sm: "14px", md: "20px" } }}
                                >
                                    {project.title}
                                </Typography>
                                <Typography
                                    fontWeight={"bold"}
                                    textAlign={"center"}
                                    variant="body2"
                                    color="textPrimary"
                                    mb={2}
                                    sx={{ fontSize: { xs: "6px", sm: "14px" } }}
                                >
                                    {project.role}
                                </Typography>
                                <Typography
                                    variant="body2"
                                    color="textSecondary"
                                    textAlign={"center"}
                                    mb={2}
                                    sx={{ fontSize: { xs: "6px", sm: "14px" } }}
                                >
                                    {project.description}
                                </Typography>
                                <Box sx={{ marginTop: "auto", textAlign: "center" }}>
                                    {project.demoLink && (
                                        <Button
                                            href={project.demoLink}
                                            variant="contained"
                                            color="primary"
                                            target="_blank"
                                            sx={{ fontSize: { xs: "8px", sm: "14px" } }}
                                        >
                                            Demo
                                        </Button>
                                    )}
                                </Box>
                            </Box>
                        </Box>
                    ))}
                </Carousel>
            </Container>
        </ThemeProvider>
    );
};

export default Project;
